import React, { useContext } from "react";
//GENERAL
import { FormControl,InputLabel,MenuItem ,Select,TextField, Grid } from "@material-ui/core";

//CONTEXT
import { ApplicantContext } from "./ApplicantContext";

export default props => {
  const [state] = useContext(ApplicantContext);
  const { user, errors } = state;
  function handleChange(event){
    this.setState({selectValue: event.target.value}, ()=> {alert(`Value: ${this.state.selectValue}`)});
    } 
  return (
    <Grid container spacing={2}>
      <Grid item xs={12} lg={2}>
      <select onChange={this.handleChange}  id="colours">
        <option value="red">Red</option>
        <option value="green">Green</option>
        <option value="blue">Blue</option>
      </select>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Salutation</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={user.salutation}
        >
          <MenuItem value={'Mr'}>Mr.</MenuItem>
          <MenuItem value={'Miss'}>Miss</MenuItem>
          <MenuItem value={'Mrs'}>Mrs</MenuItem>
          <MenuItem value={'Madam'}>Madam</MenuItem>
          <MenuItem value={'Dr'}>Dr</MenuItem>
          <MenuItem value={'Prof'}>Prof</MenuItem>
        </Select>
      </FormControl>
      </Grid>
      <Grid item xs={12} lg={3}>
        <TextField
          placeholder='Type your Surname here'
          name='last_name'
          label='Surname'
          value={user.last_name}
          variant='outlined'
          InputLabelProps={{
            shrink: true
          }}
          required
          inputProps={{
            minLength: 3,
            maxLength: 20
          }}
          error={!!errors["surname"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={3}>
        <TextField
          placeholder='Type your firstname here'
          name='first_name'
          label='Firstname'
          value={user.first_name}
          variant='outlined'
          InputLabelProps={{
            shrink: true
          }}
          required
          inputProps={{
            minLength: 3,
            maxLength: 20
          }}
          error={!!errors["firstname"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={4}>
        <TextField
          placeholder='Type your othername here'
          name='middle_name'
          label='Othername'
          value={user.middle_name}
          variant='outlined'
          InputLabelProps={{
            shrink: true
          }}
          inputProps={{
            minLength: 3,
            maxLength: 20
          }}
          error={!!errors["middle_name"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your email here'
          name='student_email_id'
          label='Email'
          value={user.student_email_id}
          type='email'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["student_email_id"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your phone here'
          name='student_mobile_number'
          label='Phone'
          value={user.student_mobile_number}
          type='tel'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["student_mobile_number"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your KCSE Grade here'
          name='kcse_grade'
          label='Kcse Grade'
          value={user.kcse_grade}
          type='text'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["kcse_grade"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Select your Category here'
          name='student_category'
          label='Student Category'
          value={user.student_category}
          type='text'
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["student_category"]}
          required
          fullWidth
        />
      </Grid>
      <Grid item xs={12}>
        <TextField
          type='text'
          name='program'
          id='program'
          label='Program'
          value={user.program}
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["program"]}
          required
          fullWidth
        />
      </Grid>

      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your Academic Year here'
          name='academic_year'
          label='Academic Year'
          type='text'
          value={user.academic_year}
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          required
          error={!!errors["academic_year"]}
          fullWidth
        />
      </Grid>
      <Grid item xs={12} lg={6}>
        <TextField
          placeholder='Type your Academic Term here'
          label='Academic Term'
          name='academic_term'
          type='text'
          value={user.academic_term}
          variant='outlined'
          margin='normal'
          InputLabelProps={{
            shrink: true
          }}
          error={!!errors["academic_term"]}
          required
          fullWidth
        />
      </Grid>
    </Grid>
  );
};
